struct casadi_nlpsol_prob {
  casadi_int nx, ng, np;
};
struct casadi_nlpsol_data {
  const struct casadi_nlpsol_prob* prob;
  casadi_real *lbz, *ubz;
  const casadi_real *p;
  casadi_real *z;
  casadi_real *lam, *lam_p;
  casadi_real f;
};
void casadi_nlpsol_work(const struct casadi_nlpsol_prob* p, casadi_int* sz_iw, casadi_int* sz_w) {
  *sz_w = *sz_iw = 0;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->nx + p->ng;
  *sz_w += p->np;
}
void casadi_nlpsol_init(struct casadi_nlpsol_data* d, casadi_int** iw, casadi_real** w) {
  casadi_int nx, ng, np;
  const struct casadi_nlpsol_prob* p = d->prob;
  nx = p->nx;
  ng = p->ng;
  np = p->np;
  d->z = *w; *w += nx + ng;
  d->lbz = *w; *w += nx + ng;
  d->ubz = *w; *w += nx + ng;
  d->lam = *w; *w += nx + ng;
  d->lam_p = *w; *w += np;
}

struct casadi_sqpmethod_prob {
  const struct casadi_nlpsol_prob* nlp;
  const casadi_int *sp_h, *sp_a, *sp_hr;
  casadi_int merit_memsize;
  casadi_int max_iter_ls;
  casadi_int sz_w_cvx;
  casadi_int sz_iw_cvx;
};
struct casadi_sqpmethod_data {
  const struct casadi_sqpmethod_prob* prob;
  casadi_real* z_cand;
  casadi_real *gLag, *gLag_old;
  casadi_real *gf;
  casadi_real *lbdz, *ubdz;
  casadi_real *dx, *dlam;
  casadi_real *Bk;
  casadi_real *Brk;
  casadi_real *Bproj;
  casadi_real* Jk;
  casadi_real* w_cvx;
  casadi_int* iw_cvx;
  casadi_real* merit_mem;
};
void casadi_sqpmethod_work(const struct casadi_sqpmethod_prob* p,
    casadi_int* sz_iw, casadi_int* sz_w) {
  casadi_int nnz_h, nnz_hr, nnz_a, nx, ng;
  nnz_h = p->sp_h[2+p->sp_h[1]];
  nnz_hr = p->sp_hr[2+p->sp_hr[1]];
  nnz_a = p->sp_a[2+p->sp_a[1]];
  nx = p->nlp->nx;
  ng = p->nlp->ng;
  *sz_w = *sz_iw = 0;
  if (p->max_iter_ls>0) *sz_w += nx + ng;
  *sz_w += nx;
  *sz_w += nx;
  *sz_w += nx;
  *sz_w += nx + ng;
  *sz_w += nx + ng;
  *sz_w += nx;
  *sz_w += nx + ng;
  *sz_w += nnz_h;
  *sz_w += nnz_hr;
  *sz_w += nx;
  *sz_w += nnz_a;
  *sz_w += p->sz_w_cvx;
  *sz_iw += p->sz_iw_cvx;
  if (p->max_iter_ls>0) *sz_w += p->merit_memsize;
}
void casadi_sqpmethod_init(struct casadi_sqpmethod_data* d, casadi_int** iw, casadi_real** w) {
  casadi_int nnz_h, nnz_hr, nnz_a, nx, ng;
  const struct casadi_sqpmethod_prob* p = d->prob;
  nnz_h = p->sp_h[2+p->sp_h[1]];
  nnz_hr = p->sp_hr[2+p->sp_hr[1]];
  nnz_a = p->sp_a[2+p->sp_a[1]];
  nx = p->nlp->nx;
  ng = p->nlp->ng;
  if (p->max_iter_ls>0) {
    d->z_cand = *w;
    *w += nx + ng;
  }
  d->gLag = *w; *w += nx;
  d->gLag_old = *w; *w += nx;
  d->gf = *w; *w += nx;
  d->lbdz = *w; *w += nx + ng;
  d->ubdz = *w; *w += nx + ng;
  d->dx = *w; *w += nx;
  d->dlam = *w; *w += nx + ng;
  d->Bk = *w; *w += nnz_h;
  d->Brk = *w; *w += nnz_hr;
  d->Bproj = *w; *w += nx;
  d->Jk = *w; *w += nnz_a;
  d->w_cvx = *w; *w += p->sz_w_cvx;
  d->iw_cvx = *iw; *iw += p->sz_iw_cvx;
  if (p->max_iter_ls>0) {
    d->merit_mem = *w;
    *w += p->merit_memsize;
  }
}

casadi_real casadi_max_viol(casadi_int n, const casadi_real* x, const casadi_real* lb, const casadi_real* ub) {
  casadi_real r;
  casadi_int i;
  const casadi_real zero = 0;
  r = 0;
  for (i=0; i<n; ++i) {
    casadi_real x_i, lb_i, ub_i;
    x_i = x ? *x++ : zero;
    lb_i = lb ? *lb++ : zero;
    ub_i = ub ? *ub++ : zero;
    r = fmax(r, fmax(x_i-ub_i, zero));
    r = fmax(r, fmax(lb_i-x_i, zero));
  }
  return r;
}

casadi_real casadi_norm_inf(casadi_int n, const casadi_real* x) {
  casadi_int i;
  casadi_real ret = 0;
  for (i=0; i<n; ++i) ret = casadi_fmax(ret, fabs(*x++));
  return ret;
}

casadi_real casadi_fabs(casadi_real x) {
/* Pre-c99 compatibility */
#if __STDC_VERSION__ < 199901L
  return x>0 ? x : -x;
#else
  return fabs(x);
#endif
}

casadi_real casadi_cvx_house(casadi_real* v, casadi_real* beta, casadi_int nv) {
  casadi_int i;
  casadi_real v0, sigma, s, v02;
  v0 = v[0];
  sigma=0;
  for (i=1; i<nv; ++i) sigma += v[i]*v[i];
  s = sqrt(v0*v0 + sigma);
  if (sigma==0) {
    *beta = 0;
  } else {
    if (v0<=0) {
      v0 -= s;
    } else {
      v0 = -sigma/(v0+s);
    }
    v02 = v0*v0;
    *beta = 2*v02/(sigma+v02);
    v[0] = 1;
    for (i=1;i<nv;++i) v[i] /= v0;
  }
  return s;
}
void casadi_cvx_house_apply_symm(casadi_int n, casadi_int k, casadi_real* A, casadi_real* p, casadi_real* v) {
  casadi_int i, j, stride, N;
  casadi_real *a;
  casadi_real beta = v[0];
  v[0] = 1;
  stride = k+1;
  A+= k+1+n*k;
  N = n-k-1;
  casadi_clear(p, N);
  a = A+n;
  for (i=0;i<N;++i) {
    p[i] += beta*(*a++)*v[i];
    for (j=i+1;j<N;++j) {
      p[j] += beta*(*a)*v[i];
      p[i] += beta*(*a++)*v[j];
    }
    a += stride+i+1;
  }
  casadi_axpy(N, -beta*casadi_dot(N, p, v)/2, v, p);
  a = A+n;
  for (i=0;i<N;++i) {
    *a++ -= 2*v[i]*p[i];
    for (j=i+1;j<N;++j) {
      *a++ -= v[i]*p[j]+v[j]*p[i];
    }
    a += stride+i+1;
  }
  v[0] = beta;
}
void casadi_cvx_tri(casadi_real* A, casadi_int n, casadi_real* p) {
  casadi_real pp[1000];
  casadi_int k, N;
  casadi_real *A_base, *v;
  casadi_real beta;
  for (k=0;k<n-2;++k) {
    A_base = A+k+1+n*k;
    N = n-k-1;
    v = A+N*n;
    casadi_copy(A_base, N, v);
    *A_base = casadi_cvx_house(v, &beta, N);
    v[0] = beta;
    casadi_cvx_house_apply_symm(n, k, A, pp, v);
  }
}
void casadi_cvx_givens(casadi_real a, casadi_real b, casadi_real* c, casadi_real* s) {
  casadi_real r;
  if (b==0) {
    *c = 1;
    *s = 0;
  } else {
    if (fabs(b)>fabs(a)) {
      r = -a/b;
      *s = 1/sqrt(1+r*r);
      *c = (*s)*r;
    } else {
      r = -b/a;
      *c = 1/sqrt(1+r*r);
      *s = (*c)*r;
    }
  }
}
void casadi_cvx_implicit_qr(casadi_int n, casadi_real* t_diag, casadi_real* t_off, casadi_real* cs) {
  casadi_real d, mu, to2, x, z, c, s, t1, t2, d0, d1, o0, o1, sd;
  casadi_int i;
  d = 0.5*(t_diag[n-2]-t_diag[n-1]);
  to2 = t_off[n-2]*t_off[n-2];
  sd = 1;
  if (d<0) sd = -1;
  mu = t_diag[n-1]-to2/(d+sd*sqrt(d*d+to2));
  x = t_diag[0]-mu;
  z = t_off[0];
  for (i=0;i<n-1;++i) {
    casadi_cvx_givens(x, z, &c, &s);
    d0 = t_diag[i];
    d1 = t_diag[i+1];
    o0 = t_off[i];
    o1 = t_off[i+1];
    t1 = d0*c-o0*s;
    t2 = o0*c-d1*s;
    t_diag[i]   = c*t1-s*t2;
    t_off[i]    = s*t1+c*t2;
    t_diag[i+1] = d0*s*s+2*s*o0*c+d1*c*c;
    t_off[i+1] *= c;
    if (i>0) {
      t_off[i-1] = t_off[i-1]*c-z*s;
    }
    x = t_off[i];
    z = -s*o1;
    if (cs) {
      *cs++ = c;
      *cs++ = s;
    }
  }
}
int casadi_cvx_symm_schur(casadi_int n, casadi_real* t_diag, casadi_real* t_off, casadi_real tol, casadi_int max_iter,
    casadi_int* trace_meta, casadi_real* trace) {
  casadi_int i, p, q, sp, sq, trace_offset, nn;
  casadi_int* n_iter;
  n_iter = trace_meta++;
  trace_offset = 0;
  q = 0;
  *n_iter = 0;
  while (q<n) {
    if (*n_iter==max_iter) return 1;
    for (i=0;i<n-1;++i) {
      if (fabs(t_off[i])<=tol*(fabs(t_diag[i])+fabs(t_diag[i+1]))) {
        t_off[i] = 0;
      }
    }
    p = 0;
    q = 0;
    sp = 0;
    sq = 0;
    for (i=0;i<n-1;++i) {
      if (t_off[n-i-2]==0 && sq==0) {
        q++;
      } else {
        sq = 1;
      }
      if (t_off[i]==0 && sp==0) {
        p++;
      } else {
        sp = 1;
      }
      if (q==n-1) {
        q = n;
        p = 0;
      }
    }
    nn = n-q-p;
    if (q<n) {
      casadi_cvx_implicit_qr(nn, t_diag+p, t_off+p, trace ? trace+trace_offset : 0);
      trace_offset += 2*(nn-1);
      if (trace_meta) {
        *trace_meta++ = nn;
        *trace_meta++ = p;
        *trace_meta++ = trace_offset;
      }
      (*n_iter)++;
    }
  }
  return 0;
}
void casadi_cvx_givens_apply(casadi_int n, casadi_real* q, casadi_real c, casadi_real s, casadi_int p) {
  casadi_real t1, t2, t3, t4, a, b;
  casadi_int i;
  casadi_real *m = q;
  m += p;
  for (i=0;i<p;++i) {
    a = m[0];
    b = m[1];
    m[0] = c*a+s*b;
    m[1] = c*b-s*a;
    m+=n;
  }
  t1 = c*m[0]+s*m[1];
  t2 = c*m[1]+s*m[n+1];
  t3 = c*m[1]-s*m[0];
  t4 = c*m[n+1]-s*m[1];
  m[0] = c*t1+s*t2;
  m[1] = c*t2-s*t1;
  m[n+1] = c*t4-s*t3;
  m = q+n*p+p+2;
  for (casadi_int i=0;i<n-p-2;++i) {
    a = m[0];
    b = m[n];
    m[0] = c*a+s*b;
    m[n] = c*b-s*a;
    m++;
  }
}
void casadi_cvx_house_apply(casadi_int n, casadi_int m, casadi_int s, casadi_real* A,
    casadi_real* p, const casadi_real* v) {
  casadi_int i, j;
  casadi_real *a;
  casadi_real beta;
  beta = v[0];
  casadi_clear(p, n);
  a = A;
  for (i=0;i<n;++i) {
    p[i] += beta*a[0];
    for (j=1;j<m;++j) {
      p[i] += beta*a[j]*v[j];
    }
    a += s;
  }
  a = A;
  for (i=0;i<n;++i) {
    a[0] -= p[i];
    for (j=1;j<m;++j) {
      a[j] -= v[j]*p[i];
    }
    a += s;
  }
}
casadi_real casadi_cvx_scalar(casadi_real epsilon, casadi_int reflect, casadi_real eig) {
  return fmax(epsilon, reflect ? fabs(eig) : eig);
}
int casadi_cvx(casadi_int n, casadi_real *A, casadi_real epsilon, casadi_real tol, casadi_int reflect, casadi_int max_iter,
    casadi_real* w, casadi_int* iw) {
  if (n==0) return 0;
  if (n==1) {
    A[0] = casadi_cvx_scalar(epsilon, reflect, A[0]);
    return 0;
  }
  casadi_cvx_tri(A, n, w);
  casadi_int i, j, n_iter, nn, p, trace_offset;
  casadi_int *t_meta;
  casadi_real c, s;
  casadi_real *cs;
  for (i=0;i<n;++i) {
    for (j=0;j<n;++j) {
      if (i-j>=2) {
        A[i+j*n] = 0;
      }
    }
  }
  casadi_real t_off0 = A[1];
  casadi_real* t_diag = A;
  casadi_real* t_off = A+n;
  for (i=1;i<n;++i) {
    t_diag[i] = A[i+n*i];
  }
  t_off[0] = t_off0;
  for (i=1;i<n-1;++i) {
    t_off[i] = A[i+1+n*i];
  }
  if (casadi_cvx_symm_schur(n, t_diag, t_off, tol, max_iter, iw, w)) return 1;
  for (i=0;i<n;++i) {
    A[i+n*i] = casadi_cvx_scalar(epsilon, reflect, t_diag[i]);
  }
  for (i=0;i<n;++i) {
    for (j=i+1;j<n;++j) A[j+i*n] = 0;
  }
  n_iter = iw[0];
  t_meta = iw+3*(n_iter-1)+1;
  for (i=0;i<n_iter;++i) {
    nn = *t_meta++;
    p = *t_meta++;
    trace_offset = *t_meta++;
    cs = w+trace_offset;
    t_meta-= 6;
    for (j=0;j<nn-1;j++) {
      s = *--cs;
      c = *--cs;
      casadi_cvx_givens_apply(n, A, c, s, p+nn-j-2);
    }
  }
  for (casadi_int k = n-3; k>=0; --k) {
    casadi_int N = n-k-1;
    casadi_real *v = A+N*n;
    casadi_cvx_house_apply_symm(n, k, A, w, v);
    casadi_cvx_house_apply(k+1, N, n, A+k+1, w, v);
  }
  return 0;
}

casadi_real casadi_sum_viol(casadi_int n, const casadi_real* x, const casadi_real* lb, const casadi_real* ub) {
  casadi_real r;
  casadi_int i;
  const casadi_real zero = 0;
  r = 0;
  for (i=0; i<n; ++i) {
    casadi_real x_i, lb_i, ub_i;
    x_i = x ? *x++ : zero;
    lb_i = lb ? *lb++ : zero;
    ub_i = ub ? *ub++ : zero;
    r += fmax(x_i-ub_i, zero);
    r += fmax(lb_i-x_i, zero);
  }
  return r;
}

casadi_real casadi_isinf(casadi_real x) {
/* Pre-c99 compatibility */
#if __STDC_VERSION__ < 199901L
  return x== INFINITY || x==-INFINITY;
#else
  return isinf(x);
#endif
}

void casadi_bound_consistency(casadi_int n, casadi_real* x, casadi_real* lam,
                                 const casadi_real* lbx, const casadi_real* ubx) {
    casadi_int i;
    casadi_real lb, ub;
    for (i=0; i<n; ++i) {
      lb = lbx ? lbx[i] : 0.;
      ub = ubx ? ubx[i] : 0.;
      x[i] = casadi_fmin(casadi_fmax(x[i], lb), ub);
      if (casadi_isinf(lb) && casadi_isinf(ub)) {
        lam[i] = 0.;
      } else if (casadi_isinf(lb) || x[i] - lb > ub - x[i]) {
        lam[i] = casadi_fmax(0., lam[i]);
      } else if (casadi_isinf(ub) || x[i] - lb < ub - x[i]) {
        lam[i] = casadi_fmin(0., lam[i]);
      }
    }
}

