    pr_inf = casadi_max_viol(4007, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(1203, d.gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(1203, d.dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
